import Togglable from "./Togglable"

const Blog = ({blog}) => {
    const blogStyle = {
        paddingTop: 10,
        paddingLeft: 2,
        border: 'solid',
        borderWidth: 1,
        marginBottom: 5
    }
    return (
        <div> 
            <div style = {blogStyle}>

                {blog.title} {blog.author} 

                <Togglable buttonLabelFirst = 'view' buttonLabelSecond = 'hide'>

                </Togglable>

            </div> 

        </div>
    )
}

export default Blog
